import { useEffect, useState } from 'react';



// ==============================|| DEFAULT DASHBOARD ||============================== //

const Dashboard = () => {
  const [ setLoading] = useState(true);
  useEffect(() => {
    setLoading(false);
  }, []);

};

export default Dashboard;
